description:
Audrey Show just showed up with the dress for her sister's wedding. Johnny wants to make sure the dress is well taken care of, but Audrey decides to try it on herself. After trying it on she accidentally spills coffee on it. Johnny is going bonkers and he's ready to tell the bride about the dress, but Audrey convinces Johnny to lie about the stain in exchange for a great fuck session.


